int main(void)
{
    //key, switch, ps2, VGA variables

    volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
    volatile int* key_data_reg = (int*)0xFF200050;

    int key_data;
    int keyboard_data;

    //int up_down_keys = 0, left_rt_keys = 0;
    int pixel_inc = 1;
    int px_size = 2;
    int x_min = 160;
    int x_max = 319;
    int y_min = 0;
    int y_max = 239;
    int x_pos = 230, y_pos = 90;

	int SW0 = 0, SW1 = 0, SW2 = 0, SW3 = 0, SW4 = 0, SW5 = 0, SW6 = 0, SW7 = 0, SW8 = 0, SW9 = 0; 
	volatile int* switch_data_reg = (int*)0xFF200040;

    //timer and blinking cursor variables
    int ld_val = 250000000;
    short int colour = 0xFFFF;
    short int save_colour = 0xFFFF;
    short int blink_colour = 0xFFFF;
    bool idle = false;
    bool wonGame = true;
    bool endGame = false;

    //set up interval timer. If user idle, change pixel 
    //colour every time the timer reaches zero to make it 'blink'
    volatile int* priv_timer_val = priv_timer_ld + 1;
    volatile int* priv_timer_ctrl = priv_timer_ld + 2;
    *priv_timer_ld = ld_val;

    /* set front pixel buffer to a different address than back buffer */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
    wait_for_vsync(&keyboard_data); //swap buffers
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen();

	//checking if user is following trace or not
	bool trace_check = true;
    short int trace[240][160];
    short int example[240][160];

    //draw image from array
    int i = 0, j = 0;
	//for template
    for (int k = 0; k < 160 * 2 * 240 - 1; k += 2) {

        int red = ((dino[k + 1] & 0xF8) >> 3) << 11;
        int green = (((dino[k] & 0xE0) >> 5)) | ((dino[k + 1] & 0x7) << 3);

        int blue = (dino[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(0 + i, j, p);
        example[i][j] = p;

        i += 1;
        if (i == 160) {
            i = 0;
            j += 1;
        }
	}	
//for trace
	i = 160;
	j = 0;
    for (int k = 0; k < 160 * 2 * 240 - 1; k += 2) {


        int red = ((dino_trace[k + 1] & 0xF8) >> 3) << 11;
        int green = (((dino_trace[k] & 0xE0) >> 5)) | ((dino_trace[k + 1] & 0x7) << 3);

        int blue = (dino_trace[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(0 + i, j, p);
        trace[i - 160][j] = p;

        i += 1;
        if (i == 320) {
            i = 160;
            j += 1;
        }
    }

    keyboard_data = 0xF0; //make pixel blink at start of game

    //FOR DEBUGGING ONLY
    //Uncomment this to draw a black screen
    //can use to test if win checking works without actually
    //drawing the dino perfectly lol
    /*
    for (int i = 0; i < 240; i++) {
        for (int j = 0; j < 160; j++) {
            example[i][j] = 0;
            trace[i][j] = 0;
        }
    }
    clear_screen();
    /*end of test code*/

    while (!endGame)
    {
        //poll switches

        int switch_data = *switch_data_reg;
		SW0 = switch_data & 0b0000000001;
		SW1 = switch_data & 0b0000000010;
		SW2 = switch_data & 0b0000000100;
		SW3 = switch_data & 0b0000001000;
		SW4 = switch_data & 0b0000010000;
		SW5 = switch_data & 0b0000100000;
		SW6 = switch_data & 0b0001000000;
		SW7 = switch_data & 0b0010000000;
		SW8 = switch_data & 0b0100000000;
		SW9 = switch_data & 0b1000000000;
        
		if (!(SW9 == 0)){                        //keeps repeating if sw9 is on
            clear_screen();
			continue;
		}
		//if switch 9 ON, clear screen. otherwise, draw the pixel, and update other data
        //change colour based on switches 2-0 
		if(SW0 == 0 && SW1 == 0 && SW2 == 0)//000
			colour = 0xFFFF;//white
		if(SW0 == 1 && SW1 == 2 && SW2 == 4)//111
			colour = 0x0000;//black
		if(SW0 == 1 && SW1 == 0 && SW2 == 0)//100
			colour = 0xF800;//red
		if(SW0 == 1 && SW1 == 0 && SW2 == 4)//101
			colour = 0xF81F;//magenta
		if(SW0 == 0 && SW1 == 2 && SW2 == 0)//010
			colour = 0x00FF;//green
		if(SW0 == 0 && SW1 == 0 && SW2 == 4)//001
			colour =0x001F;//blue
		if(SW0 == 0 && SW1 == 2 && SW2 == 4)//011
			colour = 0x07FF;//cyan
		if(SW0 == 1 && SW1 == 2 && SW2 == 0)//110
			colour = 0xFFE0;//yellow
        //colour = pixel_color(SW0, SW1, SW2);
        save_colour = colour; //save colour in case we're blinking the pixel

        //if keys aren't being pressed, measure inactive time with private timer
        if ((keyboard_data == 0xF0) && (!idle)) {
            idle = true;
            *priv_timer_ctrl = 3; //start timer with auto reload
        } else if (keyboard_data != 0xF0) {
            idle = false;
            *priv_timer_ctrl = 0; //stop timer
            plot_bigger_pixel(x_pos, y_pos, save_colour, px_size); //overwrite 'blinked' colour before continuing
        }

        //increment position
        switch (keyboard_data) {
        case 0x75:
            //(template[x_pos][y_pos - 1] == boundary || y_pos == 0) ?
            y_pos -= (y_pos <= y_min) ? 0 : pixel_inc; //go up. stop at top of screen.
            break;
        case 0x72: //down
            y_pos += (y_pos + px_size >= y_max) ? 0 : pixel_inc; //go down. stop at bottom of screen.
            break;
        case 0x6B: //left
            x_pos -= (x_pos <= x_min) ? 0 : pixel_inc; //go left. stop at edge of screen
            break;
        case 0x74: //right
            x_pos += (x_pos + px_size >= x_max) ? 0 : pixel_inc; //go right. stop at edge of screen
            break;
        default:; //do nothing
        }

        //change colour of blinking pixel 
        if (idle) {
            if ((*priv_timer_val) < (ld_val / 2)) {
                colour = (colour == blink_colour) ? 0 : blink_colour; //use black if colour is same as blink_colour
            } else {
                colour = save_colour;
            }
        }

        plot_bigger_pixel(x_pos, y_pos, colour, px_size);

        //update user's trace
        for(int x = x_pos; x < x_pos + px_size; x++)
            for(int y = y_pos; y < y_pos + px_size; y++)
                trace[x][y] = save_colour;

        //if user pressed enter, check if the drawings match. end the game.
        wonGame = true;
        if (keyboard_data == 0x5A) {
            for (int row = 0; row < 240; row++) {
                for (int col = 0; col < 160; col++) {
                    if (example[row][col] != trace[row][col]) {
                        wonGame = false;
                    }
                }
            }
            endGame = true;
        }

        wait_for_vsync(&keyboard_data);
    }

	//print game-over / win depending on wonGame
    disp_hex_msg(wonGame);
}

short int pixel_color (int r, int g, int b) { 
    return ((r<<10) + (g<<4) + b);
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void plot_bigger_pixel(int x, int y, int colour, int px_size) {
    for (int x_pos = x; x_pos < x + px_size; x_pos++)
        for (int y_pos = y; y_pos < y + px_size; y_pos++)
            plot_pixel(x_pos, y_pos, colour);
    
}

//draw black pixels to clear the entire screen
void clear_screen() {
    for (int x = 0; x <= 319; x++)
        for (int y = 0; y <= 239; y++)
            plot_pixel(x, y, 0x0000);
}

//while waiting for video out to finish drawing to VGA,
//keep reading keyboard data to prevent the ps2 read buffer from overflowing
void wait_for_vsync(int* keyboard_data_ptr) {
    volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
    volatile int* PS2_ptr = (int*)0xFF200100;
    char byte1 = 0, byte2 = 0, byte3 = 0;
    int break_key = 0xF0;
    int PS2_data;
    int RVALID;

    *(pixel_ctrl_ptr) = 1; //write 1 to reset status flag

    int status = *(pixel_ctrl_ptr + 3); //get contents of status register

    while ((status & (int)0x01) != 0) { //wait until video out has finished rendering
        status = *(pixel_ctrl_ptr + 3);
        PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            /* shift the next data byte into the display */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            if ((byte1 != break_key) && (byte2 != break_key) && (byte3 != break_key)) {
                *keyboard_data_ptr = byte3;
            } else
                *keyboard_data_ptr = break_key;
        }
    }

    //stall for a little while because otherwise the cursor moves too fast
    for (int i = 0; i < CURSOR_SPEED; i++) {
        PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            /* shift the next data byte into the display */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            if ((byte1 != break_key) && (byte2 != break_key) && (byte3 != break_key)) {
                *keyboard_data_ptr = byte3;
            }
            else
                *keyboard_data_ptr = break_key;

            HEX_PS2(byte1, byte2, byte3);
        }
    }
}

void HEX_PS2(char b1, char b2, char b3) {
    /* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
    * a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F
    */
    unsigned char seven_seg_decode_table[] = {
    0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
    0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71 };
    unsigned char hex_segs[] = { 0, 0, 0, 0, 0, 0, 0, 0 };
    unsigned int shift_buffer, nibble;
    unsigned char code;
    int i;
    shift_buffer = (b1 << 16) | (b2 << 8) | b3;
    for (i = 0; i < 6; ++i) {
        nibble = shift_buffer & 0x0000000F; // character is in rightmost nibble
        code = seven_seg_decode_table[nibble];
        hex_segs[i] = code;
        shift_buffer = shift_buffer >> 4;
    }
    /* drive the hex displays */
    *(HEX3_HEX0_ptr) = *(int*)(hex_segs);
    *(HEX5_HEX4_ptr) = *(int*)(hex_segs + 4);
}

//endlessly displays a scrolling win or lose message on the hexes
void disp_hex_msg(bool wonGame) {
    int timer_ld_val = 50000000;
    *(priv_timer_ld) = timer_ld_val;
    *(priv_timer_ld + 2) = 1;
    unsigned char congrats[14] = {0x39, 0x5C, 0x54, 0x3D, 0x50, 0x77, 0x78, 0x6D, 0x0, 0x0, 0x0, 0x0, 0x0, 0x0}; //congrats------
    unsigned char gameover[20] = {0x6D, 0x5C, 0x50, 0x50, 0x6E, 0x0, 0x6E, 0x5C, 0x3E, 0x0, 0x38, 0x5C, 0x6D, 0x79, 0x0, 0x0, 0x0, 0x0, 0x0, 0x0}; //sorry-you-lose------
    int i = 0;
    unsigned int HEX0 = 0, HEX1 = 0, HEX2 = 0, HEX3 = 0, HEX4 = 0, HEX5 = 0;

    while (true) {
        if (*(priv_timer_ld + 1) == 0) {
            //shift letters to next HEX display
            HEX5 = HEX4;
            HEX4 = HEX3;
            HEX3 = HEX2;
            HEX2 = HEX1;
            HEX1 = HEX0;
            HEX0 = wonGame ? congrats[i] : gameover[i];
            //assemble bitcodes into the right positions and write to hex display
            *(HEX3_HEX0_ptr) = ((HEX3 << 24) | (HEX2 << 16)) | ((HEX1 << 8) | HEX0);
            *(HEX5_HEX4_ptr) = ((HEX5 << 8) | HEX4);
            //reset timer load value, enable timer, reset flag
            *(priv_timer_ld) = timer_ld_val;
            *(priv_timer_ld + 2) = 1;
            *(priv_timer_ld + 3) = 1;
            i++;
        }
        
        if ((wonGame && (i >= 14)) || (!wonGame && (i >= 20))){
            i = 0;
        }
    }
}